import React from 'react'
import Stack from '@mui/material/Stack';
import Badge from '@mui/material/Badge';
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';
import { Typography } from '@mui/material';
import TurnedInIcon from '@mui/icons-material/TurnedIn';
import DoDisturbIcon from '@mui/icons-material/DoDisturb';
import CleaningServicesIcon from '@mui/icons-material/CleaningServices';
import CancelScheduleSendIcon from '@mui/icons-material/CancelScheduleSend';

const Main = () => {
  return (
    //  <Card sx={{ width: 1280,height: 50,backgroundColor: '#F3F2F1', marginTop:'-40px'}} >


<Stack spacing={5} direction="row" sx={{ marginLeft:"240px",color: 'action.active',width:"1040px",backgroundColor:"#F3F2F1",height:"50px",paddingTop:"7px",marginTop:'-45px'}}>
      <Badge color="secondary" >
        <DeleteOutlineIcon>

        </DeleteOutlineIcon>
<Typography> Delete</Typography>

      </Badge>
      <Badge color="secondary" >
<TurnedInIcon> </TurnedInIcon>
<Typography>Archive </Typography>
      </Badge>
      <Badge color="secondary" >
        
      <DoDisturbIcon></DoDisturbIcon>
<Typography> Junk</Typography>
      </Badge>
      <Badge color="secondary" >
        <CleaningServicesIcon></CleaningServicesIcon>
<Typography> Sweep</Typography>
      </Badge>
      <Badge color="secondary">
        <CancelScheduleSendIcon></CancelScheduleSendIcon>
        <Typography>Move to</Typography>
        

      </Badge>
      <Badge color="secondary" >
        
      
<Typography> Categorize</Typography>
      </Badge>
      <Badge color="secondary" >
   
<Typography> </Typography>
      </Badge>
      
    </Stack>


    //  </Card>
     

    
        
      
        
        

    
  )
}

export default Main
